        private string ReadErrorDetail(XmlReader xmlReader, int depth, out string itemId)
        {
            StringBuilder sb = new StringBuilder();
            itemId = string.Empty;
            bool needRead = true;
            do
            {
                if (needRead)
                {
                    if (!xmlReader.Read())
                        break; ;
                    needRead = false;
                }
                if (xmlReader.Depth <= depth)
                {
                    break;
                }
                switch (xmlReader.NodeType)
                {
                    case XmlNodeType.Element:
                        if (xmlReader.Name == "m:ItemId")
                        {
                            itemId = xmlReader.GetAttribute("Id");
                            needRead = true;
                        }
                        else
                        {
                            sb.AppendLine(xmlReader.ReadOuterXml());
                        }
                        break;
                    case XmlNodeType.EndElement:
                        needRead = true;
                        break;
                    case XmlNodeType.Whitespace:
                        needRead = true;
                        break;
                    default:
                        sb.AppendLine(xmlReader.ReadOuterXml());
                        break;
                }
            } while (true);
            return sb.ToString();
        }

        private string WriteDataToStream(XmlReader xmlReader, int depth, Action<string, byte[], int> writeBuffer, out string itemId)
        {
            StringBuilder sb = new StringBuilder();
            itemId = string.Empty;
            byte[] buffer = new byte[1024];
            bool isNeedRead = true;
            while (true)
            {
                if (isNeedRead)
                {
                    if (xmlReader.Read())
                    {
                        isNeedRead = false;
                        if (xmlReader.Depth <= depth)
                            break;
                    }
                    else
                    {
                        break;
                    }
                }

                switch (xmlReader.NodeType)
                {
                    case XmlNodeType.Element:
                        if (xmlReader.Name == "m:ItemId")
                        {
                            itemId = xmlReader.GetAttribute("Id");
                            isNeedRead = true;
                        }
                        else if (xmlReader.Name == "m:Data")
                        {
                            int readCount = 0;
                            do
                            {
                                readCount = xmlReader.ReadElementContentAsBase64(buffer, 0, buffer.Length);
                                writeBuffer(itemId, buffer, readCount);
                            } while (readCount == buffer.Length);
                            isNeedRead = true;
                        }
                        else
                        {
                            sb.AppendLine(xmlReader.ReadOuterXml());
                        }
                        break;
                    case XmlNodeType.EndElement:
                        isNeedRead = true;
                        break;
                    case XmlNodeType.Whitespace:
                        isNeedRead = true;
                        break;
                    default:
                        sb.AppendLine(xmlReader.ReadOuterXml());
                        break;
                }
            }
            return sb.ToString();
        }


